import { useNavigate } from 'react-router-dom';

const WorkerDashboard = () =>{
    const history = useNavigate();

    const workerDetailPage = () => {
        history("/MyAppointments");
      }
    
    return (
        <>
       <section style={{display:'flex'}}>
        <div style={{width:'20%',backgroundColor:'#1F253F', height:'100vh'}}>
        <h3 style={{textAlign: 'center',fontSize: '24px',color: 'white',padding: '20px', borderBottom: '1px solid'}}>ADMIN</h3>
        <button onClick={workerDetailPage} style={{backgroundColor:'transparent', border:'0px', width: '100%'}}><h3 style={{textAlign: 'center',fontSize: '16px',color: 'white',padding: '20px', borderBottom: '1px solid', fontWeight:'400'}}>View Appointments</h3></button>
        
        </div>
        <div style={{width:'80%',backgroundColor:'rgb(156 170 192 / 33%)', height:'100vh'}}>
        <h3 style={{textAlign: 'center',fontSize: '24px',color: '#1F253F',padding: '20px', borderBottom: '1px solid #1F253F'}}>My Dashboard</h3>

        </div>
       </section>
        </>
    );
}

export default WorkerDashboard;
